import React, {Component} from "react";
import { Row } from "reactstrap";
import GitDisc from './GitDesc';


class GitData extends Component {
  constructor(props) {
    super(props);
    this.state = {
      git: [
        {
          description: "This command is used to start a new repository.",
          id: '1'
        },
        {
          description: "This command is used to obtain a repository from an existing URL.",
          id: '2'
        },
        {
          description: "This command adds a file to the staging area.",
          id: '3'
        }
      ]
    };
  }
  render() {
    return (
    <div>
          {this.state.git.map((gitCliData, i) => ( <GitDisc key={i} gitCliData={gitCliData} /> ))}
    </div>
  );
 }
}

export default GitData;
